import pennylane as qml
from pennylane import numpy as np

def creating_written_out_ham(H_coeffs, H_gates):
    pauli_words_in_hamil = [coeff * eval("@".join([f"qml.Pauli{pauli[0]}({int(pauli[1])-1})" for pauli in term])) 
    for coeff, term in zip(H_coeffs, H_gates)]
    ham_written_out = sum(pauli_words_in_hamil[1:], pauli_words_in_hamil[0])
    return ham_written_out



